chars (text) {
	if(text\u662F\u5E26\u53D8\u91CF\u7684\u52A8\u6001\u6587\u672C){
        let element = {
            type: 2,
            expression: res.expression,
            tokens: res.tokens,
            text
        }
    } else {
        let element = {
            type: 3,
            text
        }
    }
}
