if (!oldDir) {
  // new directive, bind
  // \u89E6\u53D1\u6307\u4EE4\u4E2D\u7684\`bind\`\u94A9\u5B50\u51FD\u6570
  callHook(dir, 'bind', vnode, oldVnode);
  // \u5982\u679C\u5B9A\u4E49\u4E86inserted \u65F6\u7684\u94A9\u5B50\u51FD\u6570 \u90A3\u4E48\u5C06\u8BE5\u6307\u4EE4\u6DFB\u52A0\u5230dirsWithInsert\u4E2D
  if (dir.def && dir.def.inserted) {
    dirsWithInsert.push(dir);
  }
}
