\u4E24\u79CD\u65B9\u6CD5\u4E0D\u80FD\u88AB `,paraId:52,tocIndex:13},{value:"popstate",paraId:52,tocIndex:13},{value:" \u76D1\u542C\u5230\uFF0C\u6240\u4EE5\u9700\u8981\u5BF9\u8FD9\u4E24\u79CD\u65B9\u6CD5\u8FDB\u884C\u91CD\u5199\u6765\u5B9E\u73B0\u6570\u636E\u7684\u91C7\u96C6\u3002",paraId:52,tocIndex:13},{value:`/**
 * \u91CD\u5199pushState\u548CreplaceState\u65B9\u6CD5
 * @param {*} name
 * @returns
 */
const createHistoryEvent = function (name) {
  // \u62FF\u5230\u539F\u6765\u7684\u5904\u7406\u65B9\u6CD5
  const origin = window.history[name];
  return function (event) {
    if (name === 'replaceState') {
      const { current } = event;
      const pathName = location.pathname;
      if (current === pathName) {
        let res = origin.apply(this, arguments);
        return res;
      }
    }

    let res = origin.apply(this, arguments);
    let e = new Event(name);
    e.arguments = arguments;
    window.dispatchEvent(e);
    return res;
  };
};

window.history.pushState = createHistoryEvent('pushState');
window.history.replaceState = createHistoryEvent('replaceState');

function listener() {
  const stayTime = getStayTime(); // \u505C\u7559\u65F6\u95F4
  const currentPage = window.location.href; // \u9875\u9762\u8DEF\u5F84
  lazyReport('visit', {
    stayTime,
    page: beforePage,
  });
  beforePage = currentPage;
}

// history.go()\u3001history.back()\u3001history.forward() \u76D1\u542C
window.addEventListener('popstate', function () {
  listener();
});

// history.pushState
window.addEventListener('pushState', function () {
  listener();
});

// history.replaceState
window.addEventListener('replaceState', function () {
  listener();
});
