\u4E00\u4E2A\u5408\u5E76\u4E0A\u62A5\u3002`,paraId:66,tocIndex:17},{value:`// cache.js
const cache = [];

export function getCache() {
  return cache;
}

export function addCache(data) {
  cache.push(data);
}

// lazyReport.js
export function lazyReport(type, params) {
  // ....
  const data = getCache();

  if (delay === 0) {
    // delay=0\u76F8\u5F53\u4E8E\u4E0D\u505A\u5EF6\u8FDF\u4E0A\u62A5
    report(data);
    return;
  }

  if (data.length > 10) {
    // \u6570\u636E\u8FBE\u523010\u6761\u4E0A\u62A5
    report(data);
    clearTimeout(timer);
    return;
  }

  clearTimeout(timer);
  timer = setTimeout(() => {
    // \u5408\u5E76\u4E0A\u62A5
    report(data);
  }, delay);
}
