// \u5F53\u4F7F\u2F64 template \u65F6\uFF0Ccontext.state \u5C06\u4F5C\u4E3A window.__INITIAL_STATE__ \u72B6\u6001\u2F83\u52A8\u5D4C\u2F0A\u5230\u6700\u7EC8\u7684 HTML
// \u5728\u5BA2\u6237\u7AEF\u6302\u8F7D\u5230\u5E94\u2F64\u7A0B\u5E8F\u4E4B\u524D\uFF0Cstore \u5C31\u5E94\u8BE5\u83B7\u53D6\u5230\u72B6\u6001\uFF1A
if (window.__INITIAL_STATE__) {
  store.replaceState(window.__INITIAL_STATE__);
}
