var reverseBits = function (n) {
  let result = 0; // \u5B58\u50A8\u7ED3\u679C

  // 32\u4F4D\u4E8C\u8FDB\u5236\u6570\uFF0C\u56E0\u6B64\u9700\u8981\u79FB\u52A832\u6B21
  // \u6BCF\u6B21\u5C06n\u7684\u5DE6\u540E\u4E00\u4F4D\u79FB\u52A8\u5230result\u7684\u7B2C\u4E00\u4F4D
  for (let i = 0; i < 32; i++) {
    // \u6BCF\u6B21\u5C06\u7ED3\u679C\u5DE6\u79FB\u4E00\u4F4D\uFF0C\u5C06\u5F53\u524D\u6570\u5B57\u586B\u5165\u7A7A\u4F4D
    // \u5982\u679C\u5C06\u79FB\u52A8\u653E\u5728if\u8BED\u53E5\u4E4B\u540E\uFF0C\u4F1A\u5BFC\u81F4\u591A\u79FB\u52A8\u4E00\u4F4D
    result <<= 1;

    // \u5982\u679C\u5F53\u524Dn\u7684\u7B2C\u4E00\u4E2A\u4F4D\u7F6E\u4E3A1\uFF0C\u5219\u9700\u8981\u5C061\u586B\u5165result
    if (n & 1) {
      // \u5982\u679C\u662F1\uFF0C\u624D\u9700\u8981\u586B\u51651
      // \u5982\u679C\u662F0\uFF0C\u65E0\u9700\u586B\u5165\uFF0C\u5F53\u524D\u4F4D\u7F6E\u5DE6\u79FB\u540E\u81EA\u7136\u662F0
      result += 1;
    }

    // n\u5411\u53F3\u79FB\u52A8\u4E00\u4F4D\uFF0C\u5224\u65AD\u4E0B\u4E00\u4E2A\u4F4D\u7F6E
    n >>= 1;
  }

  return result >>> 0;
};
