var isHappy = function (n) {
  let str = String(n).split('');
  let sum = 0;
  str.forEach((item) => {
    sum += item * item;
  });
  if (sum > 9) {
    return isHappy(sum);
  }
  return sum === 1 || sum === 7;
};
