var plusOne = function (digits) {
  if (!digits.length) return;
  for (let i = digits.length - 1; i >= 0; i--) {
    digits[i]++;
    if (digits[i] === 10) {
      digits[i] = 0;
    } else {
      return digits;
    }
  }
  digits.unshift(1);
  return digits;
};
