var climbStairs = function (n) {
  //  \u722C\u4E00\u9636\u697C\u68AF\u6709\u4E00\u79CD\u65B9\u6848\uFF0C\u6240\u4EE5\u81F3\u5C11\u6709\u4E00\u79CD\u65B9\u6848r=1
  let p = 0,
    q = 0,
    r = 1;
  for (let i = 1; i <= n; i++) {
    p = q;
    q = r;
    r = p + q;
  }
  return r;
};
